import React from 'react'
import styled from 'styled-components';

const BigButton = styled.button`
  background: #FFC759;
  width: 343px;
  height: 48px;
  color: #FFFFFF;
  border: none;
  border-radius: 6px;
  font-weight: 500;
`

function handleClick(){
  console.log('test')
}

function Button(props){
  render(
  <input type="button" value={props.value} onChange={props.handleChange} onClick={() => handleClick()} />
  )
}

export default Button
